import React, { useState } from 'react'

function Navbar() {
  let [isClicked,setIsClicked]=useState(false)
  return (
    <>
    <div className='nav-comp'>
    <link to= '/' className={isClicked?'clicked':'not-clicked'} onClick={()=> {setIsClicked(true)}}>Home</link>
    <link to='/About' className={isClicked?'clicked':'not-clicked'} onClick={()=> {setIsClicked(true)}}>About Us</link>
    <a href='/SignIn' className={isClicked?'clicked':'not-clicked'} onClick={()=> {setIsClicked(true)}} >Sign In</a>
    <a href='/SignUp' className={isClicked?'clicked':'not-clicked'} onClick={()=> {setIsClicked(true)}}>Sign Up</a>
    </div>
    </>
    )
}

export default Navbar
